import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
  
       function  Calcshow(){
              return  <div id="input">
                         <div id="circles"></div>
                          div>
                       </div>  

       }


      class Calc extends React.Component{
            constructor(props){
                super(props)
            }
          render(){
                return  <div>
                       <Calcshow></Calcshow>
                       <Calcnumber></Calcnumber>
                       
                        </div>
          }
      }

  
  ReactDOM.render(
    <Calc/>,
    document.getElementById('root')
  );
